import React from "react";
import { NavLink } from 'react-router-dom';

const NavBar = () => {
  return (
    <div className="navbar">
      <li>
        <NavLink exact to="/">
          Home
        </NavLink>
      </li>
      <li>
        <NavLink exact to="/play">
          Play
        </NavLink>
      </li>
      <li>
        <NavLink exact to="/stats">
          Stats
        </NavLink>
      </li>
    </div>
  );
};

export default NavBar;
